  - name: TEXT4000
    number: '4'
    value: This note is to provide clarification of the one-time adjustment of $250.00.
      While performing an internal review of the PAC bank account
  - name: AMENDED CD
    number: '5'
    value: ' we discovered that a contribution totaling $250.00'
  - value: ' which was made prior to the 2004 election cycle'
  - value: ' had never been cashed.  Under normal conditions we would void the check
      and disclose it as a negative entry on the appropriate Schedule B.  However'
  - value: ' due to incomplete records'
  - value: ' we were unable to verify the intended recipient of this check.  In order
      to bring the FEC Report totals into line with our bank records'
  - value: ' we are disclosing the unknown check as an offset to operating expenditures
      on Line 15.  We are sure that the check was previously disclosed on the appropriate
      disbursement schedule B and that this adjustment does not consist of any new
      or previously undisclosed PAC receipts.'
  - value: ''
  expected_count: 5
  input: TEXT,SA15,A2835,"This note is to provide clarification of the one-time adjustment
    of $250.00. While performing an internal review of the PAC bank account, we discovered
    that a contribution totaling $250.00, which was made prior to the 2004 election
    cycle, had never been cashed.  Under normal conditions we would void the check
    and disclose it as a negative entry on the appropriate Schedule B.  However, due
    to incomplete records, we were unable to verify the intended recipient of this
    check.  In order to bring the FEC Report totals into line with our bank records,
    we are disclosing the unknown check as an offset to operating expenditures on
    Line 15.  We are sure that the check was previously disclosed on the appropriate
    disbursement schedule B and that this adjustment does not consist of any new or
    previously undisclosed PAC receipts.",
